var $bm_rt;
var off, off2, spd, n, val, t, p, p1, p2, v, l, nV, nVr, arr, i, inv, sc, nP;
off = $bm_div(effect('Off')('Slider').value, 100);
off2 = effect('Time Offset')('Slider').value;
spd = $bm_div(effect('Speed')('Slider').value, 100);
n = effect('Count')('Slider');
val = $bm_div(effect('Value')('Slider'), 10);
t = $bm_mul(time, spd);
p = thisComp.layer('Shape Layer 4').content('Shape 1').content('Path 1').path;
p1 = p.pointOnPath($bm_sub(1, $bm_mod(t, 1)));
p2 = p.pointOnPath($bm_sub(1, $bm_mod($bm_sum(t, off), 1)));
v = sub(p1, p2);
l = length(v);
nV = normalize(v);
nVr = [
    $bm_neg(v[1]),
    v[0]
];
arr = [p1];
for (i = 1; i < n; i++) {
    inv = $bm_mod(i, 2) == 0 ? 1 : -1;
    sc = i < $bm_div(n, 2) ? ease(i, 0, $bm_div(n, 2), 0, val) : ease(i, $bm_div(n, 2), n, val, 0);
    nP = $bm_sub($bm_sub(p1, $bm_div($bm_mul($bm_mul(nV, l), i), n)), $bm_mul($bm_mul($bm_mul(inv, nVr), Math.sin($bm_mul($bm_mul($bm_sum(time, $bm_mul($bm_mul(i, off2), thisComp.frameDuration)), Math.PI), 2))), sc));
    arr.push(nP);
}
arr.push(p2);
$bm_rt = createPath(arr, [], [], false);

